Image: 11, // swiper 配置1 options: { // autoplay: true, loop: true, direction: 'vertical', slidesPerView: 8, loopedSlides: 4, loopFillGroupWithBlank: true, // autoplay: { stopOnLastSlide: false, // swiper手动滑动之后自动轮播失效的解决方法,包括触碰，拖动，点击pagination,重新启动自动播放 disableOnInteraction: false, // 自动播放时间：毫秒 delay: 1000 }, pagination: { el: '.swiper-pagination', clickable: true // bulletClass: \\\"my-bullet\\\", } }, // swiper 配置2 options2: { direction: 'vertical', spaceBetween: 15, // 图片之间的间距 centeredSlides: true, // 居中还是从图1开始 slidesPerView: 'auto', // 一屏幕显示几个? 数字或者默认 auto 自动。 notNextTick: true, // true:加载后允许触发事件 false:加载后不可以触发事件 loop: true, // 循环吗 // initialSlide: 0, // 从第几个开始 autoplay: { delay: 500, // 等5秒下一个 disableOnInteraction: false // 中间滑动一下，取消自动吗？ }, pagination: { el: '.swiper-pagination', clickable: true }, // 下按钮 speed: 800, // 滑动时候动画的速度 paginationClickable: true, // 下面按钮让点吗 navigation: { prevEl: '.swiper-button-prev', // 左侧按钮 nextEl: '.swiper-button-next' // 右侧按钮 }, // effect: \\\"fade\\\", // 渐入效果 watchSlidesProgress: true, // 开启这个参数来计算每个slide的progress watchSlidesVisibility: true, on: { mouseenter: function() { console.log(1111) this.autoplay.stop() // 鼠标放上去时停止轮播 }, mouseleave: function() { console.log(222) this.autoplay.start() // 鼠标移出时继续轮播 } } }, // 配置3 options3: { loop: true, // 循环 notNextTick: true, slidesPerView: 6, // slide可见数量 spaceBetween: 0, // slide之间的距离（单位px） direction: 'vertical', speed: 1000, // 滚动速度 setWrapperSize: true, freeMode: true, // true则是自由模式，不会自动贴合滑动位置 autoplay: { delay: 300, // 自动切换的时间间隔，单位ms stopOnLastSlide: false, // 当切换到最后一个slide时停止自动切换 disableOnInteraction: false // 用户操作swiper之后，是否禁止autoplay // reverseDirection: false, //开启反向自动轮播 // waitForTransition: true, //等待过渡完毕。自动切换会在slide过渡完毕后才开始计时 }, observer: true, // 修改swiper自己或子元素时，自动初始化swiper observeParents: true // 修改swiper的父元素时，自动初始化swiper } } }, methods: { onMouseEnter(ref) { const ele = this.$refs.mySwiper.swiper ele.autoplay.stop() }, /** 鼠标移出 */ onMouseLeave(ref) { const ele = this.$refs.mySwiper.swiper ele.autoplay.start() } } } </script> <style lang=\\\"scss\\\" scoped> .swiperTpl { height: 100%; // height: 150px !important; .swiper { height: 100%; } } </style> \"]},\"528\":{\"h\":\"案例\"},\"529\":{\"h\":\"案例1\",\"t\":[\"详情\",\"<template> <div class=\\\"app-container\\\"> <!--主体为swiper标签--> <!--属性 :options 绑定的是data中设置的swiper配置项--> <!--属性 ref 用于获取该dom元素，在计算属性computed中将被调用--> <!--属性 id 为swiper最外层容器设置css样式--> <swiper :options=\\\"swiperOption\\\" ref=\\\"mySwiper\\\" id=\\\"mySwiper\\\"> <!--必须的组件--> <!--每页幻灯片使用swiper-slide标签--> <!--幻灯片组件生成的标签自带.swiper-slide的类名，但单类名选择器设置的部分css(如宽高)将被覆盖--> <swiper-slide class=\\\"swiper_slide_item\\\">I'm Slide 1</swiper-slide> <swiper-slide class=\\\"swiper_slide_item\\\">I'm Slide 2</swiper-slide> <swiper-slide class=\\\"swiper_slide_item\\\">I'm Slide 3</swiper-slide> <!-- 可选的控件 --> <!--分页器--> <div class=\\\"swiper-pagination\\\" slot=\\\"pagination\\\"></div> <!--滚动条--> <div class=\\\"swiper-scrollbar\\\" slot=\\\"scrollbar\\\"></div> <!--前进后退按钮--> <div class=\\\"swiper-button-prev\\\" slot=\\\"button-prev\\\"></div> <div class=\\\"swiper-button-next\\\" slot=\\\"button-next\\\"></div> </swiper> <!--配置自定义的页面跳转按钮，to(page)为自定义方法，其内调用了swiper的内置方法--> <button @click=\\\"to(1)\\\">点击跳转到Slide 1</button> <button @click=\\\"to(2)\\\">点击跳转到Slide 2</button> <button @click=\\\"to(3)\\\">点击跳转到Slide 3</button> </div> </template> <script> export default { name: \\\"carrousel\\\", data() { return { //swiperOption：swiper配置项信息，需要绑定在swiper标签的 :option 属性中 swiperOption: { //幻灯片放映方向 direction: 'vertical', //通常不与左右按钮一同使用 //分页器配置项 pagination: { el: \\\".swiper-pagination\\\", //分页器的类名 clickable: true, // 点击分页器跳切换到相应的幻灯片 type: 'bullets' | 'progressbar' | 'fraction' , //小圆点|进度条|数字页码 dynamicBullets: true, //动态小圆点(type:'bullets'时) //自定义分页器，需设置样式 renderBullet(index, className) { return `<span class=\\\"${className} swiper-pagination-bullet-custom\\\">${index + 1}</span>` }, }, //前进后退按钮 navigation: { nextEl: '.swiper-button-next', prevEl: '.swiper-button-prev' }, //滚动条 scrollbar: { el: '.swiper-scrollbar', hide: true }, //幻灯片播放配置项 loop: true, //是否循环播放 speed: 1000, // 发生页面切换动画时，动画的切换速度 autoplay: { delay: 2000, // 幻灯片停留时间 disableOnInteraction: false, // 用户操作swiper之后，是否禁止autoplay stopOnLastSlide: true, // 切换到最后一个slide时是否停止自动切换。（loop模式下无效）。 }, on: { slideChangeTransitionEnd: function () { console.log(this.activeIndex); //每次切换结束时，在控制台打印现在是第几个slide }, }, }, }; }, //计算属性 computed: { swiper() { return this.$refs.mySwiper.$swiper; }, }, //设置自定义的按钮，点击后将前往目标也页 methods: { to(index) { this.swiper.slideTo(index) console.log(this.swiper); } } }; </script> \"]},\"530\":{\"h\":\"案例2\"},\"531\":{\"h\":\"案例3（配置项汇总）\",\"t\":[\"点击展开/折叠代码块\",\" // 配置1 swiperOption: { direction: 'vertical', // spaceBetween: 15, // 图片之间的间距 centeredSlides: true, // 居中还是从图1开始 slidesPerView: 6, // 一屏幕显示几个? 数字或者默认 auto 自动。 notNextTick: true, // true:加载后允许触发事件 false:加载后不可以触发事件 loop: true, // 循环吗 initialSlide: 0, // 从第几个开始 autoplay: { delay: 5000, // 等5秒下一个 disableOnInteraction: false // 中间滑动一下，取消自动吗？ }, pagination: { el: '.swiper-pagination', clickable: true }, // 下按钮 speed: 800, // 滑动时候动画的速度 paginationClickable: true, // 下面按钮让点吗 navigation: { prevEl: '.swiper-button-prev', // 左侧按钮 nextEl: '.swiper-button-next' // 右侧按钮 }, // effect: 'fade', // 渐入效果 watchSlidesProgress: true, // 开启这个参数来计算每个slide的progress watchSlidesVisibility: true // 先要开启watchSlidesProgress参数，如果开启watchSlidesVisibility，则会在每个slide增加一个指示该slide的progress值得classname // autoHeight: true // 图片高度自适应 }, // swiper 配置2 swiperOption2: { direction: 'vertical', spaceBetween: 15, // 图片之间的间距 centeredSlides: false, // 居中还是从图1开始 slidesPerView: 6, // 一屏幕显示几个? 数字或者默认 auto 自动。 notNextTick: true, // true:加载后允许触发事件 false:加载后不可以触发事件 loop: true, // 循环吗 // initialSlide: 0, // 从第几个开始 autoplay: { delay: 5000, // 等5秒下一个 disableOnInteraction: false // 中间滑动一下，取消自动吗？ }, pagination: { el: '.swiper-pagination', clickable: true }, // 下按钮 speed: 800, // 滑动时候动画的速度 paginationClickable: true, // 下面按钮让点吗 navigation: { prevEl: '